import "./App.css";
import { Route, Routes, useLocation, useNavigate } from "react-router-dom";
import { useState, useEffect, useRef } from "react";
import Splash from "./components/splash";
import Main from "./components/main";

function App() {
  const [loginState, setLoginState] = useState(false);

  const updateLogedIn = () => {
    setLoginState(true);
  };
  return (
    <div className="ALL">
      {loginState === false ? (
        <Routes>
          <Route
            path="/"
            element={
              <Splash loginState={loginState} updateLogdedIn={updateLogedIn} />
            }
            exact={true}
          />
        </Routes>
      ) : (
        <Routes>
          <Route
            path="/Main"
            element={
              <Main loginState={loginState} updateLogedIn={updateLogedIn} />
            }
            exact={true}
          />
        </Routes>
      )}
    </div>
  );
}

export default App;
